<template>
    <div class="warp">
        <div class="title">人脸识别认证</div>
        <div class="titles">请您拍摄完整的脸部照片，用于身份验证</div>
        <img class="ide" src="@/assets/images/BOCM/ide.png" alt="" />
        <div class="box">
            <!--图片展示-->
            <img
                src="@/assets/images/BOCM/480.gif"
                alt=""
                v-show="state == 'img' && boxImg == 'one'"
            />
            <img
                src="@/assets/images/BOCM/false.png"
                alt=""
                v-show="state == 'img' && boxImg == 'two'"
            />
            <img
                src="@/assets/images/BOCM/true.png"
                alt=""
                v-show="state == 'img' && boxImg == 'three'"
            />
            <canvas
                ref="canvas"
                width="680"
                height="600"
                v-show="false"
            ></canvas>
            <!--canvas截取流-->
            <video
                width="680"
                height="600"
                ref="video"
                autoplay
                playsinline="false"
                webkit-playsinline="false"
                v-show="state == 'video'"
            ></video>
        </div>
        <div class="text" v-if="textState == 'zero'">
            请保持光线明亮，摄像头无遮挡
        </div>
        <div class="text" v-if="textState == 'one'">人脸识别验证中，请稍后</div>
        <div class="text" style="color: #ff432f" v-if="textState == 'two'">
            人脸识别失败
        </div>
        <div class="text" style="color: #06ba7a" v-if="textState == 'three'">
            人脸识别成功
        </div>
        <!--拍照上传-->
        <div class="btn" v-if="btnState == 'one'" @click="photograph">
            我已准备好，开始验证
        </div>
        <div class="btn" v-if="btnState == 'two'" @click="anew">重新识别</div>
        <div class="btn" v-if="btnState == 'three'" @click="goAccount">
            进入下一步
        </div>
        <!--        弹窗-->
        <div class="pop" v-if="popShow">
            <div class="sbox">
                <div class="head">提醒</div>
                <div class="main">
                    您已禁止掌厅访问改设备相机，请在设置-隐私-相机中允许掌厅访问相机功能。
                </div>
                <div class="sure" @click="popShow = false">确认</div>
            </div>
        </div>
    </div>
</template>
<script>
import api from "@/common/apiUrls.js";
export default {
    name: "faceRecognition",
    data() {
        return {
            state: "",
            textState: "zero",
            btnState: "one",
            popShow: false,
            boxImg: "",
            livingOrderNo: "", //活体识别号
            accountFrom: "",
            faceType: "",
            test1: 
            ""
        };
    },
    created() {
        this.callCamera();
        console.log(this.$route.query);
        this.accountFrom = this.$route.query.accountFrom || "";
        if(this.accountFrom) {
            this.faceType = "CANCEL_ACCOUNT";
        } else {
            this.faceType = "OPEN_ACCOUNT";
        }
    },
    methods: {
        // 调用摄像头
        callCamera() {
            this.state = "video";
            // H5调用电脑摄像头API
            //navigator.mediaDevices.getUserMedia 调用后 会提示用户给予使用媒体输入的许可.返回一个 Promise 对象，
            //成功后会resolve回调一个 MediaStream 对象。
            //在移动设备上面调用摄像头也可以通过此种方式，如下的例子表示优先使用前置摄像头
            //{ audio: true, video: { facingMode: "user" } }前摄像头
            //{ audio: true, video: { facingMode: { exact: "environment" } } }强制使用后置摄像头
            //设置获取接近 1280x720 的相机分辨率
            //{ audio: true, video: { width: 1280, height: 720 } };
            navigator.mediaDevices
                .getUserMedia({
                    audio: false, //调用音频
                    video: true, //说明请求的媒体类型。调用视频
                })
                .then((success) => {
                    // 摄像头开启成功
                    this.$refs["video"].srcObject = success; //src 是播多媒体文件的；srcobj 是实时流
                    // 实时拍照效果
                    this.$refs["video"].play();
                })
                .catch((error) => {
                    //用户拒绝
                    this.popShow = true;
                    console.error("摄像头开启失败，请检查摄像头是否可用！");
                });
        },
        // 拍照
        photograph() {
            this.state = "img";
            this.boxImg = "one";
            this.btnState = "";
            this.textState = "one";
            let ctx = this.$refs["canvas"].getContext("2d");
            // 把当前视频帧内容渲染到canvas上
            ctx.drawImage(this.$refs["video"], 0, 0);
            //canvas图片 转base64格式、图片格式转换、图片质量压缩
            //语法 canvas.toDataURL(type, encoderOptions); 设置转换的图片格式、图片质量压缩
            let imgBase64 = this.$refs["canvas"].toDataURL("image/jpeg", 0.7);
            let str = imgBase64.replace("data:image/jpeg;base64,", "");
            let strLength = str.length;
            let fileLength = parseInt(strLength - (strLength / 8) * 2); //
            let size = (fileLength / 1024).toFixed(2); // 由字节转换为KB 判断大小
            console.log(size); //图片大小
            console.log(imgBase64);
            this.closeCamera();
            this.recongnition(imgBase64);
        },
        // 关闭摄像头
        closeCamera() {
            if (!this.$refs["video"].srcObject) {
                return;
            }
            //MediaStream 接口的getTracks() 方法会返回一个包含媒体流中所有媒体对象
            let stream = this.$refs["video"].srcObject;
            let tracks = stream.getTracks();
            tracks.forEach((track) => {
                track.stop();
            });
            this.$refs["video"].srcObject = null;
        },
        anew() {
            this.textState = "zero";
            this.btnState = "one";
            this.boxImg = "";
            this.callCamera();
        },
        //上传识别
        recongnition(imgBase64) {
            api.BOCM.face({
                userImage: imgBase64.slice(23),
                // userImage: this.test1,
                userName: this.$route.query.userName,
                faceType: this.faceType,
                idNo: this.$route.query.idNo,
            })
                .then((res) => {
                    this.textState = "three";
                    this.btnState = "three";
                    this.boxImg = "three";
                    this.livingOrderNo = res.livingOrderNo;
                })
                .catch((err) => {
                    console.log(err);
                    this.textState = "two";
                    this.btnState = "two";
                    this.boxImg = "two";
                });
        },
        //去开户
        goAccount() {
            if (this.accountFrom) {
                this.$router.push({
                    name: "cancellValiID",
                    query: {
                        ...this.$route.query,
                        orgCode: this.$route.query.orgCode,
                        livingOrderNo: this.livingOrderNo,
                    },
                });
            } else {
                this.$router.push({
                    name: "walletOpenAccValiCode",
                    query: {
                        ...this.$route.query,
                        orgcode: "BOCM",
                        livingOrderNo: this.livingOrderNo,
                    },
                });
            }
        },
    },
};
</script>
